INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES (119901, 0, "2024/12/22 12:00:00", 1, 14, 302, 1, "2024/12/31 11:59:59", 1, "ミヤコ（クリスマス）", 0, "【物理】中衛で、味方をプリンで強化する幽霊聖少女。\n物理攻撃力と物理クリティカルアップのプリンパワーの\nフィールドで自分のスキルも強化し、猛攻を繰り出す。", 119901, 119901, "みやこ", 0, 1, 0, 3, 2.17, 0, 0, 450, 119901);
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES (120001, 0, "2024/03/22 12:00:00", 1, 6, 190, 5, "2024/03/28 11:59:59", 5, "シズル（ノワール）", 0, "【物理】前衛で猛攻から味方を守護する闇のお姉ちゃん。\nバトル開始時の行動不能無効スキルで周囲の味方を守り、\n範囲を束縛するスキルで敵を牽制し、戦況を一変する。", 120001, 120001, "しずる", 0, 1, 0, 3, 2.375, 0, 0, 450, 120001);
INSERT INTO `v1_19d574ad31217b4bc230b2d87a01f51eb39702935f12806c197dd1d3b7d3c9e6` VALUES (120101, 0, "2015/04/01 15:00:00", 0, 0, 0, 7, "2030/12/31 15:00:00", 7, "イオ（ノワール）", 0, "", 120101, 0, "いお", 0, 0, 0, 3, 0.0, 0, 0, 0, 0);
